Онлайн-кинотеатр START снимает и показывает сериалы, которые регулярно возглавляют зрительские рейтинги. А ещё на START большая библиотека кино, сериалов и мультфильмов от ведущих студий мира.

START — это:
— одна подписка на весь каталог;
— премьеры сериалов и фильмов собственного производства START;
— большой выбор кино, сериалов, мультфильмов от главных студий;
— доступ к любимым фильмам на всех устройствах в любой точке мира;
— дополнительные материалы о съемках;
— возможность смотреть кино и сериалы на любых устройствах;
— качество Full HD 1080p;
— никакой рекламы, совсем;
— функция скачивания и просмотра без интернета (можно скачивать и кино, и эпизоды сериалов, и мультики);
— до 5 отдельных пользовательских профилей, а для детей — безопасный детский режим без взрослого контента;
— 7 дней бесплатно для новых подписчиков.

Подписка на онлайн-кинотеатр START дает возможность смотреть весь каталог с новинками кино, эксклюзивными сериалами и премьерами. И всё это по цене пары билетов в обычный кинотеатр.

Что такое «пробная подписка» на неделю? Первые 7 дней все новые пользователи могут смотреть START бесплатно. Если в течение этих 7 дней вы отмените подписку, автопродление отключится автоматически. И фильмы с сериалами отключатся тоже. Если этого не сделать, после пробного бесплатного периода с вашего счета будет списана месячная оплата подписки.

Далее подписка будет автоматически продлеваться каждые 30 дней, пока вы ее не отмените.

Остались вопросы? Напишите нам: support@start.film

Watch TV channels, films, TV series and cartoons with Kyivstar TV media service on smartphones and tablets.

Kyivstar TV is an interactive television with legal content from Ukrainian and international TV channels in HD and standard quality. Also, with the availability of an extensive library of films, TV series, cartoons and shows!

Kyivstar TV is available to all mobile operators in Ukraine. To log in to the application, mobile subscribers need to enter their phone number, and Kyivstar «Home Internet» subscribers need to enter their personal account number and password.

 Benefits:
 - Up to 5 devices can be connected to 1 account: smartphone, tablet, Smart TV, set-top box or computer;
 - more than 300 TV channels from all over the world, including 100+ in HD quality and 50+ exclusive channels from Kyivstar TV;
 - live control functions: pause and rewind on more than 140 channels;
 - the opportunity to watch the broadcast in the last 7 days on more than 140 channels;
 - built-in TV program;
 - video library, which has more than 20 000 movies, TV series, cartoons and shows without advertising;
 - the ability to continue watching the film at any time from the moment where you stopped;
 - a system of recommendations for films, series and shows, which takes into account your preferences;
 - high image quality (up to 4k) and sound (5.1);
 - «Favourites» function – the ability to create your own playlist to your liking;
 - «Chromecast» for TV and large screens with Chromecast support;
 - the ability to choose the quality of the video;
 - the ability to filter content by genre, rating, country, year of release, audio track and subtitles;
 - consumption of mobile traffic for Kyivstar subscribers on a smartphone is equal to 0.

 More details about tariffs and Kyivstar TV service – https://tv.kyivstar.ua/ua/tariffs

